# import the necessary packages
import numpy as np
import cv2
import imutils
x=np.zeros((500,400),dtype='uint8')
x1=np.zeros((500,400),dtype='uint8')
y=cv2.rectangle(x,(0,0),(200,250),255,-1)
z=cv2.ellipse(x1,(200,250),(int(400*0.75)//2,int(500*0.75)//2),0,0,360,255,-1)
z=cv2.subtract (y,z)
cv2.imshow('g',z)
cv2.waitKey()
cv2.destroyAllWindows
